yncLoadingScreen]", "99813EC44D7D970A9AD6529A0E88B424", "Tip 3: If you find a toilet in your dream, don\'t use it."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "919B641747A87305057CA69E52E67B1D", "Tip 4: Don\'t yell at your kids, lean in close and whisper, it\'s much scarier."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "9DE619334C0AF744AB49EEBB28EC2300", "Tip 5: If you attempt to rob a bank, you will have no trouble with rent or bills for the next ten years, whether you are successful or not."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "81DE7C714665C66CBC2312A5CD608114", "Tip 6: Don\'t sweat the petty things and don\'t pet the sweaty things."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "D5B6ACCC41FB9042A740B7968B6495C9", "Tip 7: No matter how nice the hand soap smells, don’t leave the restroom smelling your fingers."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "D43CE2DB4D96164AD7C946AD2059894F", "Tip 8: If life gives you lemons, squeeze the juice into a water gun and shoot other people in the eyes."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "2FBD2D05490438D38AF62B9EF878D659", "Tip 9: If no one comes from the future to stop you from doing it, then how bad of a decision can it really be?"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "BA87C18C461E5BC12CBF5587AB19689C", "Tip 10: Eat whatever you want, and if someone calls you fat, eat them too."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "D407D06640E7D1CFAB1262A3F7F5AD66", "Tip 11: Drinking can cause memory loss, or even worse, memory loss."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "615C08C9453915C59FAEFB81B58969F0", "Tip 12: If you swim with a friend, your chances of getting eaten by a shark will drop by 50%."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "9F10E39C400F31AFE2B885B70721D328", "Tip 13: If you can’t blind them with brilliance, baffle them with nonsense."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "3369D8504D716E1E537C5085F38A817A", "Tip 14: You don’t need a parachute to go skydiving. You only need a parachute to go skydiving twice."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "7D5D790E4D7A6534DD5E64ACCC5E2A81", "Tip 15: Don\'t give up your dreams, keep on sleeping."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "659593174F8DA4FD8612858F827C4317", "Tip 16: In case of fire, exit the building before tweeting about it."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "303F912E4C4153827BA0D4A862214F35", "Tip 17: If you break your bone in two places, don’t go to those places again."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "F957E6AE4FDFF77B194C90A100C11A98", "Tip 18: When you fart in public, yell \"Jet power!\" and walk faster."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "B8FE23F2453505A6E479EFB5EF14CFEF", "Tip 19: If you wait until the last minute to do it, it only takes a minute to do."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "3A5F8C0D4F5F6457C69A6BA05D649F1B", "Tip 20: Never use your favorite song as an alarm. You\'ll start to hate it."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "4EC156484A9A5D94D6AB3480703EBD1E", "Tip 21: Do not think of yourself as an ugly person. Think of yourself as a majestic baboon."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "6B54788944705F98DE7869BE9A1195C4", "Tip 22: For $1, you can buy a candy bar from a vending machine. For $2, you can buy a brick, and get all the candy in the vending machine."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "74FF6B504C1D2330FE4E45B79BE65093", "Tip 23: Don\'t be sad, because sad backward is das and das not good."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "900C1C29451ECD35057E3795060BA45F", "Tip 24: Put a teabag in your whiskey, so you can day drink without being judged."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "1860446F46E01A9E0F0436941C7B258C", "Tip 25: Never walk on the ice with your hands in your pockets."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "2C47D50043E4993FBE2C8889DAB69EB5", "Tip 26: If your dog blinks at you blink back. It could be a code."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "FE53A1174D937231D6F269